const initInstrumentVueComponents=e=>{const t=new Vue({el:e.sentimentElementId,data:{usersSellPercentage:e.usersSellPercentage,usersBuyPercentage:e.usersBuyPercentage,isClientSentimentsDataValid:e.isClientSentimentsDataValid}}),n=new Vue({el:e.rootElementId,data:e,computed:{arrowDirection:()=>({"icon-arrow-down6":this.changePercent<0,"icon-arrow-up6":this.changePercent>=0})},directives:{"instrument-icon":instrumentIconDirective()},mounted:()=>{setTimedInterval(()=>{$.ajax({type:"GET",contentType:"text/plain",url:e.feedsObj.url,data:$.param({instrumentID:e.id}),success:i=>{n.buyPrice=i.BuyPrice?i.BuyPrice.toFixed(n.precision):"",n.sellPrice=i.SellPrice?i.SellPrice.toFixed(n.precision):"",n.highPrice=i.HighPrice?i.HighPrice.toFixed(n.precision):"",n.lowPrice=i.LowPrice?i.LowPrice.toFixed(n.precision):"",n.changePercent=i.ChangePercent,n.changePercentText=i.ChangePercentText,n.changeColor=changeColor(i.ChangePercent),n.changeThreshold=isThresholdReached(i.ChangePercent,e.highlightThreshold),t.isClientSentimentsDataValid=i.IsSentimentValid,t.usersSellPercentage=i.UsersSellPercentage,t.usersBuyPercentage=i.UsersBuyPercentage}})},e.feedsObj.intervalRateInSeconds,48e4);const i=e.tooltipAdditionalText;[].slice.call(document.querySelectorAll('[data-bs-toggle="tooltip"]')).map(e=>(e.title+=i,new bootstrap.Tooltip(e)))}})};